import logo from "./images/netflix-Logo.svg";
import magnifying_glass from "./images/magnifying_glass.svg";
import React from "react";
import HeaderCss from "./header.module.css";


function Header() {
  return (
    <>
      <div>
        <nav>
          <img className={HeaderCss.nav_logo} src={logo} alt="Netflix Logo" />
          <ul className = {HeaderCss.nav}>
            <li className = {HeaderCss.nav_text}>Home</li>
            <li className = {HeaderCss.nav_text}>TV Shows</li>
            <li className = {HeaderCss.nav_text}>Movies</li>
            <li className = {HeaderCss.nav_text}>New & Popular</li>
            <li className = {HeaderCss.nav_text}>My List</li>
            <li className = {HeaderCss.nav_text}>Browse by Languages</li>
          </ul>
         <img  className = {HeaderCss.icons} src={magnifying_glass}></img>
        </nav>
           </div>
    </>
  );
}

export default Header;
